## Remarks  
 <span data-ttu-id="4767c-102"><xref:System.ServiceModel.Configuration.WebHttpElement>는 <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> 하위 형식으로서 구성을 통해 엔드포인트에 <xref:System.ServiceModel.Description.WebHttpBehavior>를 포함하는 데 사용할 수 있습니다.</span><span class="sxs-lookup"><span data-stu-id="4767c-102">The <xref:System.ServiceModel.Configuration.WebHttpElement> is a <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> sub-type that can be used to include the <xref:System.ServiceModel.Description.WebHttpBehavior> on an endpoint through configuration.</span></span> <span data-ttu-id="4767c-103">합니다 <xref:System.ServiceModel.Description.WebHttpBehavior> 동작을 함께 사용 하는 경우는 <xref:System.ServiceModel.WebHttpBinding> Windows Communication Foundation (WCF) 서비스에 대 한 웹 프로그래밍 모델을 사용 하면 바인딩.</span><span class="sxs-lookup"><span data-stu-id="4767c-103">The <xref:System.ServiceModel.Description.WebHttpBehavior> behavior, when used in conjunction with the <xref:System.ServiceModel.WebHttpBinding> binding, enables the Web programming model for a Windows Communication Foundation (WCF) service.</span></span> <span data-ttu-id="4767c-104"><xref:System.ServiceModel.Web.WebServiceHost>는 <xref:System.ServiceModel.WebHttpBinding>을 사용하는 엔드포인트에 이 동작을 자동으로 추가합니다.</span><span class="sxs-lookup"><span data-stu-id="4767c-104">Note that the <xref:System.ServiceModel.Web.WebServiceHost> automatically adds this behavior to endpoints that use the <xref:System.ServiceModel.WebHttpBinding>.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="4767c-105">이 샘플에서는 <xref:System.ServiceModel.Configuration.WebHttpElement> 형식을 반환합니다.</span><span class="sxs-lookup"><span data-stu-id="4767c-105">This sample returns the type <xref:System.ServiceModel.Configuration.WebHttpElement>.</span></span>  
  
```  
using System;  
using System.ServiceModel;  
using System.ServiceModel.Web;  
using System.ServiceModel.Configuration;  
  
    class Program  
    {  
        static void Main(string[] args)  
        {  
            WebHttpElement webHttpElement = new WebHttpElement();  
            Console.WriteLine("The type is: {0}", webHttpElement.BehaviorType);  
            Console.WriteLine("Press <ENTER> to terminate the program.");  
            Console.ReadLine();  
        }  
    }  
```

  
  
